import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

let currDate = new Date();
let currTime = currDate.getHours();
let str;
if(currTime >= 1 && currTime < 12){
    str = "Good Morning";
}
else if(currTime >= 12 && currTime < 18){
    str = "Good Afternoon";
}
else{
    str = "Good Night";
}

const clr ={
    key : "value"
}


